#include <string.h>

/**
 * 所有元素两两比较，每次找出一个最大或最小元素放在数组后面
 */
void bubble_sort(int arr[], int len, char asc[]){
	/**
	 * 一共做 len - 1 次
	 * 每次轮遍 len - 1 - i个元素
	 * 每次把一个符合的元素放到数组最后一个元素前面
	 * 比如: 5, 8, 7, 1
	 * 降序: 一共做 3 次
	 * 第一次: j<3 ， 把1放到了最后
	 * 第二次: j<2 ， 把5放到了倒数第二
	 * 第三次: j<1 ， 把7放到了倒数第三
	 */
	int i,j,temp;
	for(i = 0; i < len - 1; i++){
		for(j = 0; j < len - 1 - i; j++){
			if(strcmp(asc, "asc") == 0){
				if(arr[j] > arr[j+1]){
				     temp = arr[j];
					arr[j] = arr[j+1];
					arr[j+1] = temp;
				}
			} else {
			   	if(arr[j] < arr[j+1]){
				     temp = arr[j];
					arr[j] = arr[j+1];
					arr[j+1] = temp;
				}
			}
		}
	}
}

/**
 *  每次找出一个最大或者最小的放在数组前部分
 */
void selection_sort(int arr[], int len, char asc[]){
int i,j;
	for(i = 0; i < len; i++){
		int temp = NULL;
		int tempIndex = NULL;
		for(int j = i; j < len; j++){
			if(strcmp(asc, "asc") == 0){
				// 升序
				if(!temp){
					temp = arr[j];
				} else {
					if(temp > arr[j]){
						temp = arr[j];
						tempIndex = j;
					}
				}
			} else {
				// 降序
				if(!temp){
					temp = arr[j];
				} else {
					if(temp < arr[j]){
					temp = arr[j];
					tempIndex = j;
				   }
				}
			}
		}
//		printf("temp: %d ....\n", temp);
//		printf("tempIndex: %d ....\n", tempIndex);
//		printf("i: %d ....\n", i);
//		printf("\n");
		if(tempIndex){
			arr[tempIndex] = arr[i];
		}
		arr[i] = temp;
	}
}

void insertion_sort(int arr[], int len){
    int i,j,temp;
    for (i=1;i<len;i++){
            temp = arr[i];
            for (j=i;j>0 && arr[j-1]>temp;j--)
                    arr[j] = arr[j-1];
            arr[j] = temp;
    }
}
/**
 * 从第一个元素开始，每次多一个元素，元素一进来就排好序
 */
void insertion_sort1(int arr[], int len, char sort[]){
	  int i,j,temp;
	            for(i = 1; i < len; i++){
	               temp = arr[i];
	               for(j = i; j > 0; j--){
	                  if(strcmp(sort, "asc") == 0){
	                  // 升序
	                  if(arr[j - 1] > temp){
	                    arr[j] = arr[j - 1];
	                  } else {
	                  // 若此索引上的元素不满足条件了，则取这个j为temp元素插入的索引
	                    break;
	                  }
	                  } else {
	                  // 降序
	                       if(arr[j - 1] < temp){
	                    arr[j] = arr[j - 1];
	                  } else {
	                  // 若此索引上的元素不满足条件了，则取这个j为temp元素插入的索引
	                    break;
	                  }
	                  }
	               }
	               arr[j] = temp;
	            }
}






int min(int x, int y) {
    return x < y ? x : y;
}
void merge_sort(int* arr[]) {
	int len = sizeof(*arr) / sizeof(*arr[0]);
	printf("%d\n", sizeof(arr));
    int* a = arr;
    int* b = (int*) malloc(len * sizeof(int));
    int seg, start;
    for (seg = 1; seg < len; seg += seg) {
        for (start = 0; start < len; start += seg + seg) {
            int low = start, mid = min(start + seg, len), high = min(start + seg + seg, len);
            int k = low;
            int start1 = low, end1 = mid;
            int start2 = mid, end2 = high;
            while (start1 < end1 && start2 < end2)
                b[k++] = a[start1] < a[start2] ? a[start1++] : a[start2++];
            while (start1 < end1)
                b[k++] = a[start1++];
            while (start2 < end2)
                b[k++] = a[start2++];
        }
        int* temp = a;
        a = b;
        b = temp;
    }
    if (a != arr) {
        int i;
        for (i = 0; i < len; i++)
            b[i] = a[i];
        b = a;
    }
    free(b);
}



void merge_sort1(int* arr){
	printf("%d\n", sizeof(*arr));
	int len = 30240;
	int block = 1;
	int b[len];
	  while(block < len){

	            for(int i = 0; i < len; i += block*2){

	                int tempIndex = i;

	                int start1 = i;
	                int end1 = start1 + block > len ? len : start1 + block;

	                int start2 = end1;
	                int end2 = start2 + block > len ? len : start2 + block;

	                while(start1 < end1 && start2 < end2){
	                    if(arr[start1] > arr[start2]){
	                        b[tempIndex++] = arr[start2++];
	                    } else {
	                        b[tempIndex++] = arr[start1++];
	                    }
	                }
	                while(start1 < end1){
	                    b[tempIndex++] = arr[start1++];
	                }
	                while(start2 < end2){
	                    b[tempIndex++] = arr[start2++];
	                }
	            }
	            for(int i = 0; i < len; i++){
	            	arr[i] = b[i];
	            }
	            block *= 2;
	        }
}




